**Describe the bug**
Looking to update C# code to accommodate latest ML.net and onnxruntime versions.  Getting hung-up on a similar issue as my original post [#1417](https://github.com/microsoft/onnxruntime/issues/1417) that was working under a previous onnxruntime v0.4.0 but is no longer under v1.5.2.

**Urgency**
On critical path to update production code and operations.

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04):  Win 10 Pro 19041
- ONNX Runtime installed from (source or binary):  binary
- ONNX Runtime version:  1.5.2
- ONNX Runtime
- Visual Studio version (if applicable):  16.8.1
- Microsoft.ML.OnnxConverter: 0.17.2

**To Reproduce**
When building the model, I have 100 input columns of which 1 is a binary Label (0,1) and 96 are used as Features with the remaining 3 are reference columns I can use to identify the source of the record.  When I attempt to inference a test record with one dummy label column and 96 feature values, I get an unhandled exception when I attempt to assign the dense tensor: 

> System.ArgumentOutOfRangeException: 'Dimensions must be non-negative Parameter name: dimensions'

See attached image below.

- Describe steps/code to reproduce the behavior.
```csharp
 Console.WriteLine("=============== Inference Onnx Model Begin ===============");

 // Optional : Create session options and set the graph optimization level for the session
 SessionOptions sessOptions = new SessionOptions();
 sessOptions.GraphOptimizationLevel = GraphOptimizationLevel.ORT_ENABLE_BASIC;

 using (var session = new InferenceSession(onnxModelPath, sessOptions))
 {
        var inputMeta = session.InputMetadata;
        var container = new List<NamedOnnxValue>();

         float[] inputData1 = new float[97] { 1f,   // Dummy Label Column
                                            35f, 24f, 13.4883f, 25f, 99f, 62.7967f, 48f, 47f, 28.4488f, 60f,
                                            75f, 49.3083f, 19f, 11f, 12.4294f, 12f, 28f, 20.8595f, 31f, 17f,
                                            8.4301f, 13f, 6f, 4.718f, 33.25f, 133f, 99f, 62.7967f, 41.0069f, 35.8817f,
                                            135.1481f, 133.6822f, 0.71f, 1.37f, 1.71f, 0.54f, 0.4f, 0.65f, 1.63f, 2.58f,
                                            4.13f, 1.96f, 3.13f, 0.46f, 0.23f, 0.36f, 1.55f, 0.61f, 4.66f, 2.11f,
                                            3.66f, 0.44f, 0.92f, 0.3f, 0.68f, 0.4f, 0.5833f, 0f, 0.8f, 0.4833f,
                                            1f, 0.7833f, 0f, 0.2286f, 0.6762f, 0.781f, 0.9429f, 1f, 0f, 0.1998f,
                                            0.6212f, 0.8053f, 0.9301f, 1f, 0.4177f, 0.4271f, 0.4469f, 0.4555f, 0.4613f, 0.4646f,
                                            0.2025f, 0.2039f, 0.2067f, 0.2079f, 0.2088f, 0.2092f, 0.5125f, 0.5112f, 0.5276f, 0.5574f,
                                            0.5458f, 0.698f, 1.1195f, 1.1928f, 0.9797f, 1.01f };

        int i = 0;
        int startSlot = 3;
        foreach (var name in inputMeta.Keys)
        {
           if (i >= startSlot) // Skip reference Fields except rHProf
            { 
                Console.WriteLine(name);
                var tensor = new DenseTensor<float>(new float[] { inputData1[i - startSlot] }, inputMeta[name].Dimensions);
                 container.Add(NamedOnnxValue.CreateFromTensor<float>(name, tensor));
            }
            i++;
        }

        // Run the inference
        // results is an IDisposableReadOnlyCollection<DisposableNamedOnnxValue> container
        using (var results = session.Run(container))  
        {
              // dump the results
               foreach (var r in results)
               {
                     Console.WriteLine(string.Format("Output for {0} = ", r.Name));
                     Console.WriteLine(string.Format("{0}", r.AsTensor<float>().GetArrayString()));
                }
         }
  }

    Console.WriteLine("=============== Inference Onnx Model End ===============");
}
catch (Exception ex)
{
    Console.WriteLine("Error: {0}\nCallStack: {1}\n Inner Exception: {2}", ex.Message, ex.StackTrace, ex.InnerException != null ? ex.InnerException.Message : "No Inner Exception");
    throw ex;
}

```
- Attach the ONNX model to the issue (where applicable) to expedite investigation.
[MES_4Range_UpFPP_ZZ16_HP12_20200101_20201031_ONNX_Model.zip](https://github.com/microsoft/onnxruntime/files/5559863/MES_4Range_UpFPP_ZZ16_HP12_20200101_20201031_ONNX_Model.zip)

**Expected behavior**
Looking for a straightforward way to inference an onnx model when the dimensions of the training/testiing data, features, and inferencing data do not precisely line up.  Model building is an iterative process whereby I am constantly performing different experiments by adding/removing features and would prefer not to have to build or modify a schema each time if I can properly manage the sequence of feature columns within the block between training/testing and inferencing.  Plus I will always want to maintain a few reference data items in the first few columns of each record to know the source of the data.    

